def my_func(s):
    def is_palindrome(word):
        return word == word[::-1]

    words = s.split()
    transformed_words = []

    for word in words:
        if len(word) >= 5 and not is_palindrome(word):
            # Reverse words of length 5 or more, unless they are palindromes
            transformed_words.append(word[::-1])
        else:
            # Keep words of length less than 5 or palindromes unchanged
            transformed_words.append(word)

    return ' '.join(transformed_words)
